import { atom } from "recoil";
import { useCourFactory } from "../customHooks/useCourFactory";
import { useYearFactory } from "../customHooks/useYearFactory";

type ApiKeyValue = {
    year: string | undefined;
    cour: string | undefined;
}
const { current_year } = useYearFactory()
const year_number = String(current_year)
const { current_season } = useCourFactory()

export const ApiKeyValue = atom<ApiKeyValue>({
    key: 'ApiKeyValue',
    default: {year: year_number, cour: current_season}
})
